--
-- Definition of procedure `ATTENDANCE_INSERT`
--

DROP PROCEDURE IF EXISTS `ATTENDANCE_INSERT`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `ATTENDANCE_INSERT`(
in _empid varchar(20),
in _date_time datetime,
in _work_code int,
in _state int
)
BEGIN

DELETE FROM tblattendance where empid=_empid and date_time=_date_time;

VALUES(_empid, _date_time, _work_code, _state);

END $$
