--
-- Definition of procedure `BENEFIT_SELECT_AMOUNT_BYID`
--

DROP PROCEDURE IF EXISTS `BENEFIT_SELECT_AMOUNT_BYID`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `BENEFIT_SELECT_AMOUNT_BYID`(
in _code varchar(50),
in _basic_salary decimal(20,2)
)
BEGIN

Declare amt decimal(20,2);
Declare amt_l varchar(50);



Select amount_lookup INTO amt_l from tblbenefits where code=_code;

SET @varcode=_code; 
SET @varbasicsal=_basic_salary; 


SET @here="Select amount from tblbenefits where code=?";
SET @sss="Select total_contribution as amount from tblsssbracket where ? between low and high";
SET @philhealth="Select monthly_premium as amount from tblphilhealthbracket where ? between low and high";
SET @pagibig="SELECT ? * .025 as amount";

if amt_l="here" then
        PREPARE stmt from @here;
        EXECUTE stmt USING @varcode;
        DEALLOCATE PREPARE stmt;
elseif amt_l="SSS" then
        PREPARE stmt from @sss;
        EXECUTE stmt USING @varbasicsal;
        DEALLOCATE PREPARE stmt;
elseif amt_l="PhilHealth" then
        PREPARE stmt from @philhealth;
        EXECUTE stmt USING @varbasicsal;
        DEALLOCATE PREPARE stmt;
elseif amt_l="Pag-IBIG" then
        PREPARE stmt from @pagibig;
        EXECUTE stmt USING @varbasicsal;
        DEALLOCATE PREPARE stmt;
end if;


END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

