--
-- Definition of procedure `TOGGLE_RESTRICTION`
--

DROP PROCEDURE IF EXISTS `TOGGLE_RESTRICTION`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `TOGGLE_RESTRICTION`(
IN _empid varchar(25),
IN _restriction_name varchar(100),
IN _newvalue boolean
)
BEGIN

SET @column = _restriction_name;
SET @empid = _empid;
SET @newval=_newvalue;

SET @s = CONCAT('UPDATE tblemprestrictions SET ', @column,'=',@newval,' where empid="', @empid, '"');

PREPARE stmt FROM @s;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;


END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;



